import {makeStyles} from "@material-ui/core/styles";

export const useStyles = makeStyles(theme => ({
    toolbar: theme.mixins.toolbar,
    content: {
        flexGrow: 1,
        display: 'flex',
        flexDirection: 'column',
        padding: '16px',
    },
}));
